export const Header = () => {
    return (
        <div style={{ 
            border: '0.3px solid red',
            width:'100%',
            flex:1,
            display:'flex',
            justifyContent:"center",
            flexDirection:"row", }}>

            <div style={{
                width:'30vh',
                display:'flex',
                border:'1px solid black',
                flex:0.3}}>
                {/* logo section */}
                <h3>DoDo List</h3>
            </div>
            <div  style={{
                border:'1px solid black',
                flex:0.3}}>
                {/* search section */}
                search
            </div >
            <div  style={{
                border:'1px solid black',
                flex:0.3}}>
                {/* icon section */}
                icon
            </div>
        </div>
    )
}
